long long findmin(vector<int> &arr)
    {
        long long maxi=INT_MIN;
        for(long long  it:arr)
        maxi=max(maxi,it);
        return maxi;
    }
    
    long long findmax(vector<int> &arr)
    {
        long long sum=0;
        for(long long it:arr)
        sum+=it;
        return sum;
    }
    
    long long possible(vector<int> arr, int mid)
    {
        int count=0;
        int temp=0;
        for(int i=0;i<arr.size();i++)
        {
            temp+=arr[i];
            if(temp>mid)
            {
                count++;
                temp=arr[i];
            }
        }
        count++;
        cout<<"count is "<<count<<endl;
        return count;
    }
    
    long long minTime(vector<int>& arr, int k) {
        // code here
        // return minimum time
        long long low=findmin(arr);
        long long high=findmax(arr);
        if(k==1) return high;
        while(low<=high)
        {
            long long mid=(low+high)/2;
            cout<<"high and low are "<<high<<"  "<<low<<endl;
            int ans=possible(arr,mid);
            if(ans>k) low=mid+1;
            else high=mid-1;
        }
        long long fans=possible(arr,low);
        if(fans<=k)
        {
        cout<<low<<endl;
        return low;
        }
        return -1;
    }
